import React, { Component } from "react";
import List from "./List.js";
import NewsletterList from "./NewsletterList";

class App extends Component {
  open;
  render() {
    return (
      <main>
        <div className="tab-btns">
          <button onClick="openTab(event, 'users')">users</button>
          <button onClick="openTab(event, 'newsletter')">newsletter</button>
        </div>
        <div className="tab1">
          <h1>List of users </h1>
          {/* <Sorting sortList={this.sortList} />
          <Filtering filterList={this.filterList} />
          <List user={text} /> */}
          <List />
        </div>
        <div className="tab2">
          <h1>List of subscribers</h1>
          <NewsletterList />
        </div>
      </main>
    );
  }
}

export default App;
